import React from 'react'
import MediaCard from './Card';
import { Grid } from '@material-ui/core';
import Emily from '../../images/sample_image.jpg';

const directors=[
    {
        name: "Jessica Li",
        designation: "Director of Banking - Sell Side",
        linkedin: "",
        image: {Emily},
    },
    {
        name: "Cara Nguyen",
        designation: "Director of Banking - Buy-Side",
        linkedin: "",
        image: {Emily},
    },
    {
        name: "Madelyn Wells",
        designation: "Director of Consulting",
        linkedin: "",
        image: {Emily},
    },
    {
        name: "Emily Lai",
        designation: "Director of Accounting",
        linkedin: "",
        image: {Emily},
    },
    {
        name: "Mina Han",
        designation: "Director of Marketing",
        linkedin: "",
        image: {Emily},
    },
]

function E_Board() {
    return (
        <Grid container spacing={4} justify="center">
            {directors.map((e)=>{
                return (
                    <Grid item xs={6} sm={4}>
                        <MediaCard 
                            name={e.name}
                            designation={e.designation}
                            linkedin={e.linkedin}
                            image={e.image}/>
                    </Grid>
                );
            })}
        </Grid>
    )
}

export default E_Board
